o: “I had been being very sick and had a really bad headache so I booked an early scan and that was when I found out I was expecting triplets. It was the biggest shock of my life!\n\n“We haven’t got any triplets in the family so it came completely out of the blue.”","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/ADhRAV3ywQI/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDvyzaQFHQshnZnphuZEvZqsVKfAA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/ADhRAV3ywQI/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLA1w4PgZIFFsanfXwHAdRB3OyIqnA","width":196,"height":110},{"url":"https://i.ytimg.com/vi/ADhRAV3ywQI/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCBQiN1gzwbZTiZjbBRAggMLjqhGQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/ADhRAV3ywQI/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAoiX51RPJ2enG3DJCrSz2xhZhutA","width":336,"height":188},{"url":"https://i.ytimg.com/vi/ADhRAV3ywQI/maxresdefault.jpg","width":1920,"height":1080}]},"useCipher":false,"averageRating":4.7018323,"allowRatings":true,"viewCount":"3857849","author":"AMAZING STORY TODAY","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"230000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/y_ezFyPzXlum5ZbGPd0y6w/featured_channel.jpg?v=58afed4e","width":40,"height":40}]},"trackingParams":"CAQQ8zciEwjQ2MHh_YnqAhVjqHwKHRNCA_s=","navigationEndpoint":{"clickTrackingParams":"CAQQ8zciEwjQ2MHh_YnqAhVjqHwKHRNCA_syAml2","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCy_ezFyPzXlum5ZbGPd0y6w","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UCy_ezFyPzXlum5ZbGPd0y6w"}},"channelName":"AMAZING STORY TODAY","subscribeButton":{"subscribeButtonR cription":{"simpleText":"Mom Gives Birth To Triplets. Doctor Freezes When He Sees Faces, Says Odds Are 1 In 200 Million\n\nBecki-Jo Allen and her young daughter Indiana lived a safe, quiet and comfortable life in England.\n\nOne day, however, Becki-Jo began to feel nauseous and suspected she might have fallen pregnant again.\n\nIt turned out she was indeed expecting … expecting triplets! When the time came to deliver them, however, a surprise even bigger than that announcement was to come. What happened was so rare that the chances of it occurring stand as high as 200 million to 1.\n\nBecki-Jo and her daughter Indiana live just outside the city of Liverpool, England. Their life was a calm one, until one day Becki-Jo began to suspect something was happening inside her body. It started when she began to suffer from nausea.\n\nBecki-Jo told the Liverpool Echo: “I had been being very sick and had a really bad headache so I booked an early scan and that was when I found out I was expecting triplets. It was the biggest shock of my life!\n\n“We haven’t got any triplets in the family so it came completely out of the blue.”"},"lengthSeconds":"230","ownerProfileUrl":"http://www.youtube.com/channel/UCy_ezFyPzXlum5ZbGPd0y6w","externalChannelId":"UCy_ezFyPzXlum5ZbGPd0y6w","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY
